import React from 'react';
import Header from './header.js';

function Search_conts({list, word}) {
    console.log(list)
    list.map((str,idx) => {
        idx === 0 ? (
            str.map((s) => {
                    s === word ? (
                        console.log(word)
                    ) : (
                        console.log(s)
                    )
            })
        ) : (
            str.map((s) => {
                    s === word ? (
                        console.log(word)
                    ) : (
                        console.log(s)
                    )
            })
        )
    })
    return (
        <div class="div2">
            <ul>
            {list.map((string) => {
                return(    
                <li class="left">
                {
                    string.map((str, idx) => {
                       return (
                        <p>
                        {idx === 0 ? (
                        str.map((s) => {
                            return(
                                s === word ? (
                                    <span class = "div2-title bold">{ s }</span>
                                ) : (
                                    <span class = "div2-title">{ s }</span>
                                )
                            )
                        })
                        ) : (
                        str.map((s) => {
                            return(
                                s === word ? (
                                    <span class = "div2-cont bold">{ s }</span>
                                ) : (
                                    <span class = "div2-cont">{ s }</span>
                                )
                                
                            )
                        })
                        )}
                        </p>
                       )
                    })
                }
                </li>
                )
            })}
            </ul>   
        </div>
    )
      
}


export default Search_conts;
